('55','1','1','Kod producenta: A2E15-dkg Marki: Timberland Płeć: Męskie Typ: Buty Zimowe Kolor:Zielone Style: Buty Zimowe Materiał: Materiał Tekstylny Kolekcja: Jesień Zima 2020 Zielone, męskie, wodoodporne, zimowe buty za kostkę od Timberland, to kolejna odsłona popularnych hikerów tym razem z wykorzystaniem materiałów tekstylnych. Gumowa zapiętka zapobiega otarciom i zachlapaniom podczas użytkowania. Cholewka delikatnie skrócona w tylnej części gwarantuje wygodę, a przy tym nie wpływa na ochronę przed zimnem. Wnętrze wykonane z materiału tekstylnego. Wzorzyste dodatki w połączeniu z jaskrawymi wstawkami dodają przełamania i dodają młodzieżowego designu, a przy tym nie wpływają na ich uniwersalność. Zastosowanie jednego kawałka materiału i szycie tylko w jednym miejscu pozwala zagwarantować pełną wodoodporność nawet bez dodatkowego impregnowania. Najbardziej narażone na zabrudzenia i zniszczenia miejsca zostały zabezpieczone gumowymi, łatwymi do czyszczenia elementami. Buty idealnie sprawdzą się na miejskie zimy, ale też na dłuższe wyprawy terenowe. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'euro-sprint-fabric-wp',NULL,NULL,NULL,'Euro Sprint Fabric Wp',NULL,NULL,NULL,NULL),
