('57','1','1','Kod producenta: A2BF8-olv Marki: Timberland Płeć: Męskie Typ: Półbuty Kolor:Brązowe Style: Buty Za Kostkę Materiał: Skóra Kolekcja: Jesień Zima 2020 Zimowe obuwie marki Timberland to kolejna odsłona tego producenta tym razem dla panów. Casualowy styl połączony z delikatnie zaokrąglonymi kształtami łączy w sobie odrobinę elegancji z elementami codziennego outfitu. Cholewka sięgająca delikatnie za kostkę wykonana została z najwyższej jakości skóry licowej w kolorze oliwkowym. Znane z hikerów metalowe skuwki, to jeden ze sportowych elementów tego casualowego modelu, tak jak delikatnie zainspirowany z hikerów branding. Klasycznego charakteru nadaje za to płaska podeszwa, a mimo wszystko z odpowiednio wyprofilowanym bieżnikiem w celu zapewnienia odpowiedniej przyczepności, jak i amortyzacji wstrząsów. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'ashwood-park-hiker',NULL,NULL,NULL,'Ashwood Park Hiker',NULL,NULL,NULL,NULL),
