('59','1','1','Kod producenta: A26AP-dkg Marki: Timberland Płeć: Męskie Typ: Buty Zimowe Kolor:Zielone Style: Buty Zimowe Materiał: Materiał Tekstylny Kolekcja: Jesień Zima 2020 Sportowa odsłona jednego z bardziej popularnych modeli butów marki Timberland. Męskie, wodoodporne buty zimowe wykonane z materiału syntetycznego Rebolt, którego włókna w 40% produkowane są z przetworzonych butelek PET. Cholewka powstała z wykorzystaniem powłoki Timberdry, która zapewnia ochronę przed wodą, a przy tym ułatwia cyrkulację powietrza wewnątrz buta. Podeszwa wykonana z wysokogatunkowych materiałów z odpowiednio profilowanym bieżnikiem została zaprojektowana w celu zapewnienia odpowiedniej przyczepności, a zastosowana wkładka Ortholite o Twoje stopy. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'sprint-trekker-fabric',NULL,NULL,NULL,'Sprint Trekker Fabric',NULL,NULL,NULL,NULL),
