('73','1','1','Kod producenta: 740CMA0020-1W7 Marki: Lacoste Płeć: Męskie Typ: Półbuty Kolor:Brązowe Style: Buty Za Kostkę Materiał: Skóra Kolekcja: Jesień Zima 2020 Skórzane buty za kostkę w oryginalnym, miejskim designie od Lacoste. Podwyższona cholewka wykonana z najwyższej jakości wodoodpornej skóry naturalnej w kolorze brąowym. Podeszwa z delikatnymi wyżłobieniami od spodu pozwolą na stabilne poruszanie się. Zastosowana technologia Ortholite flex we wnętrzu buta gwarantuje odpowiednią cyrkulację powietrza, zapobieganie wilgoci oraz wygodę użytkowania, a przy tym nie dodaje obuwiu dodatkowego ciężaru. Niewielki logotyp w kolorze cholewki umieszczony na zamszowej wstawce. W górnej części cholewki znajduje się wstawka, której zadaniem jest zapobieganie otarciom podczas użytkowania obuwia. Brązowe sznurowadła z delikatnymi białymi wstawkami dodają charakteru. Obuwie idealnie sprawdzi się podczas miejskiej zimy. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'esparre-chukka-0320-1-cma',NULL,NULL,NULL,'Esparre Chukka 0320 1 Cma',NULL,NULL,NULL,NULL),
