('95','1','1','Kod producenta: K300305-003 Marki: Camper Płeć: Męskie Typ: Półbuty Kolor:Czarne Style: Buty Za Kostkę Materiał: Skóra Kolekcja: Jesień Zima 2020 Skórzane półbuty za kostkę marki Camper. Męskie obuwie dla osób ceniących sobie w głównej mierze komfort. Jedne z najwygodniejszych butów w klasycznym stylu wykonane z wysokiej jakości skóry naturalnej. Wygodę gwarantuje specjalnie profilowany kształt podeszwy. Wszelkie łączenia materiałów wykonane są z najwyższą starannością przez co buty idealnie sprawdzą się na wiele sezonów. Elastyczne sznurowadła na pewno ułatwią zakładanie butów. Wyróżniający się kolor podeszwy nadaje przełamania dla klasycznego wyglądu, a przy tym nie ujmuje jego uniwersalności. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'peu-touring',NULL,NULL,NULL,'Peu Touring',NULL,NULL,NULL,NULL),
