('97','1','1','Kod producenta: K300281-005 Marki: Camper Płeć: Męskie Typ: Półbuty Kolor:Czarne Style: Buty Za Kostkę Materiał: Skóra Kolekcja: Jesień Zima 2020 Jedne z najwygodniejszych butów w opinii klientów. Połączenie naturalnej skóry, niepowtarzanego designu i niesamowitego komfortu może zapewnić jedynie marka Camper. Cholewka wykonana z naturalnej skóry licowej o wysokości 11 cm , gwarantuje odpowiednie zabezpieczenie kostki podczas zimowej aury. Wnętrze wyściełane zostało materiałem tekstylnym, a podeszwa wykonana została przy użyciu pianki EVA, co gwarantuje lekkość, a przy tym trwałość, odporność na mróz oraz uszkodzenia. Kształt cholewki i wyprofilowana podeszwa gwarantuje, że nasza stopa będzie idealnie ułożona podczas użytkowania tego obuwia, a to wpłynie na naszą postawę i zdrowie kręgosłupa. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'formiga',NULL,NULL,NULL,'Formiga',NULL,NULL,NULL,NULL),
