('147','1','1','Kod producenta: EM0-0580-BDS Marki: Tommy Hilfiger Płeć: Męskie Typ: Półbuty Kolor:Czarne Style: Street Materiał: Skóra Kolekcja: Jesień Zima 2020 Męskie sneakersy skórzane marki Tommy Hilfiger to sportowa propozycja tego nowojorskiego producenta. Cholewka wykonana została z wysokiej jakości, naturalnej skóry licowej z ozdobnym dziurkowaniem. Wkładka oraz wnętrze buta zostało wykończone materiałem tekstylnym. Podwyższona podeszwa wykonana została z wysokogatunkowego tworzywa, którego zadaniem jest amortyzacja wstrząsów, a podwyższona odporność na ścieranie oraz naprężenia gwarantuje trwałość przez wiele sezonów. Obuwie to idealnie zgra się z miejskimi stylizacjami. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'blake-14a',NULL,NULL,NULL,'Blake 14a',NULL,NULL,NULL,NULL),
