('151','1','1','Kod producenta: 633K55264-brn Marki: Bullboxer Płeć: Męskie Typ: Półbuty Kolor:Brązowe Style: Buty Za Kostkę Materiał: Skóra Kolekcja: Jesień Zima 2020 Skórzane, męskie półbuty jesienno-zimowe Bullboxer to świetna propozycja dla panów ceniących sobie wygodę połączoną z klasycznym wyglądem. Obuwie holenderskiego producenta cechuje się trwałym wykonaniem i użyciem najwyższej jakości materiałów. Z zewnątrz obuwie wykonane jest z naturalnej skóry typu licowego w kolorze brązowy, oraz dodatkiem materiału tekstylnego w celu zapewnienia użytkownikowi komfortu. Wysokość cholewki to 8 centymetrów. Wnętrze buta wykonane jest z materiału tekstylnego. Delikatne wzory wykonane na cholewce w postaci delikatnych dziurek na skórze dodają nowoczesnego wyglądu bardzo klasycznym na pierwszy rzut oka butom. Obuwie proponowane dla panów ceniących sobie klasyczne półbuty za kostkę na każdą okazję, świetnie wpasują się w biurową stylizację, jak i codzienny miejski spacer. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'daniel-brown',NULL,NULL,NULL,'Daniel Brown',NULL,NULL,NULL,NULL),
