('161','1','1','Kod producenta: A2E1R-blk Marki: Timberland Płeć: Męskie Typ: Buty Zimowe Kolor:Czarne Style: Buty Zimowe Materiał: Materiał Tekstylny Kolekcja: Jesień Zima 2020 Czarne, męskie, wodoodporne, zimowe buty za kostkę od Timberland, to kolejna odsłona popularnych hikerów tym razem z wykorzystaniem materiałów tekstylnych. Gumowa zapiętka zapobiega otarciom i zachlapaniom podczas użytkowania. Cholewka delikatnie skrócona w tylnej części gwarantuje wygodę, a przy tym nie wpływa na ochronę przed zimnem. Wnętrze wykonane z materiału tekstylnego. Zastosowanie jednego kawałka materiału i szycie tylko w jednym miejscu pozwala zagwarantować pełną wodoodporność nawet bez dodatkowego impregnowania. Najbardziej narażone na zabrudzenia i zniszczenia miejsca zostały zabezpieczone gumowymi, łatwymi do czyszczenia elementami. Buty idealnie sprawdzą się na miejskie zimy, ale też na dłuższe wyprawy terenowe. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'euro-sprint-fabric-wp',NULL,NULL,NULL,'Euro Sprint Fabric Wp',NULL,NULL,NULL,NULL),
