('207','1','1','Kod producenta: A41WX-blk Marki: Timberland Płeć: Damskie Typ: Buty Zimowe Kolor:Czarne Style: Buty Zimowe Materiał: Skóra Kolekcja: Jesień Zima 2020 Damskie, skórzane buty zimowe od Timberland to najnowsza odsłona łącząca w sobie najwyższej jakości materiały i technologie z 6inch oraz oryginalny design. Wodoodporna cholewka wykonana została z wysokogatunkowej skóry naturalnej typu nubuk. Jej wodoodporność gwarantuje dodatkowa warstwa ochronna DWR jak i poczwórne szycie, dzięki którym obuwie staje się świetną ochroną przed wodą. Górna część cholewki wykonana została z materiału syntetycznego. Użycie wewnątrz warstwy ocieplającej sprawia, że obuwie idealne sprawdzi się nawet przy niskich temperaturach. Dodatkowy element kolorystyczny w postaci pomarańczowych sznurowadeł dodaje nowoczesnego wyglądu. Podeszwa wykonana z tworzywa posiada specjalnie żłobiony bieżnik w celu zapewnienia odpowiedniej przyczepności i amortyzacji. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'6-inch-premium-treadlight',NULL,NULL,NULL,'6-inch Premium Treadlight',NULL,NULL,NULL,NULL),
