('229','1','1','Kod producenta: EN0-1074-BDS Marki: Tommy Hilfiger Płeć: Damskie Typ: Wysokie Buty Kolor:Czarne Style: Buty Za Kostkę Materiał: Skóra Kolekcja: Jesień Zima 2020 Zamszowe kozaki z ociepleniem od Tommy Hilfiger to must have w szafie każdej stylowej pani szczególnie gdy zima za pasem. Skórzana cholewka wykonana z najwyższej jakości zamszu zasłania prawie całą łydkę. Ocieplenie wewnątrz buta, delikatnie wywinięte na zewnątrz gwarantuje, że nawet chłodniejsze dni nie będą nam straszne. Delikatny logotyp znajdziemy standardowo w miejscy pięty oraz delikatnie podkreślony na ociepleniu. Wyprofilowany bieżnik podeszwy z delikatnym obcasem zapewni nam stabilność i przyczepność nawet na śliskim podłożu. Obuwie jest idealnym dopełnieniem do casualowego outfitu. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'yvonne-11bw',NULL,NULL,NULL,'Yvonne 11bw',NULL,NULL,NULL,NULL),
