('231','1','1','Kod producenta: DM26262001 Marki: Dr Martens Płeć: Damskie Typ: Buty Zimowe Kolor:Czarne Style: Buty Zimowe Materiał: Skóra Kolekcja: Jesień Zima 2020 Jedne z najbardziej popularnych butów od 1960 roku, to oczywiście klasyczne 1460 od Dr Martens. Tego producenta kojarzymy głównie z produkcją skórzanych glanów, a ten model to świetne potwierdzenie, że producent wie czego oczekują jego klienci. Trwała i wysoka cholewka wykonana z najwyższej jakości skóry naturalnej, do tego łączona z podeszwą z pomocą szewskiej techniki Goodyear welted, co gwarantuje ich trwałość, bo cholewka jest pierwotnie zszywana, a następnie zgrzewana z podeszwą. Producent oprócz trwałości zapewnia komfort, a to dzięki umieszczonej w podeszwie poduszce powietrznej amortyzującej wstrząsy. Obuwie, jak pokazują jego użytkownicy wpasuje się idealnie w każdą stylizacje i to niezależnie od pory roku! Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'1460-w',NULL,NULL,NULL,'1460 W',NULL,NULL,NULL,NULL),
