('249','1','1','Kod producenta: A2EWK-gry Marki: Timberland Płeć: Damskie Typ: Buty Zimowe Kolor:Szare Style: Buty Zimowe Materiał: Skóra Kolekcja: Jesień Zima 2020 Najpopularniejsze hikery Timberland w nowej odsłonie kolorystycznej. Połączenie dobrze znanej i cenionej sylwetki z modnymi w tym sezonie kolorami. Cholewka wykonana ze skóry nubuk w kolorze szarym z miękko wyściełaną otoczką przy górze cholewki w kolorze różowym. Wnętrze wyściełane materiałem mimo braku ocieplenia gwarantuje, że nawet chłodne dni nie będą straszne. Delikatny, lekko sportowy kształt z logotypami w kilku dobrze widocznych miejscach w połączeniu z wąską i profilowaną podeszwą wykonaną z najwyższej jakości materiału poza świetnym wyglądem gwarantują wygodę oraz odporność na wstrząsy. Obuwie będzie idealnym dopełnieniem do codziennego zimowego outfitu oraz spacerów. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'euro-sprint-hiker',NULL,NULL,NULL,'Euro Sprint Hiker',NULL,NULL,NULL,NULL),
