('335','1','1','Kod producenta: 740CUJ0010-312 Marki: Lacoste Płeć: Damskie Typ: Półbuty Kolor:Czarne Style: Buty Za Kostkę Materiał: Materiał Syntetyczny Kolekcja: Jesień Zima 2020 Damskie, wysokie tenisówki marki Lacoste. Propozycja na jesień i zimę dla pań ceniących sobie młodzieżowe i delikatne stylizacje, a przy tym uniwersalizm. Cholewka wykonana z materiału syntetycznego. Lekkie wykonanie w klasycznym designie. Biały otok podeszwy sprawia, że buty nabierają miejskiego, codziennego charakteru. Wysokiej jakości materiały zastosowane podczas produkcji sprawiają, że buty idealnie nadają się do użytku w sezonie jesienno-zimowym. Na środku cholewki umieszczony jest zielony krokodyl, który stał się ponadczasowym symbolem tej marki cenionej za wysoką jakość i wygodę. Wnętrze wykonane z materiału tekstylnego, a wkładka wyposażona została w technologię Ortholite. Prosimy sprawdzić regulamin i warunki przed złożeniem zamówienia Jeżeli znajdziesz błąd w opisie lub charakterystyce butów, proszę pomóż nam poprawić opis i wyślij do nas maila ',NULL,'gripshot-mid-0120-2-cuj',NULL,NULL,NULL,'Gripshot Mid 0120 2 Cuj',NULL,NULL,NULL,NULL),
